import Header from './Components/Header';
import Routes, { Route } from 'react-router-dom'
import './App.css';

function App() {
  return (
    <Routes>
      <Route index element={
            <main>
            <Header/>
            <Post/>
            <Post/>
            <Post/>

          </main>
      }/>


    </Routes>

  );
}

export default App;
